const employees = (employees = [], action) => {
  switch (action.type) {
    case "FETCH_ALL_EMPLOYEES":
      return action.payload;
    case "UPDATE_EMPLOYEES":
      console.log(action.payload, "")
      return action.payload;
    default:
      return employees;
  }
};
export default employees;
